// 상단바용 공용 UI
import React from 'react';
import { Link } from 'react-router-dom';

function NavBar(){
    return (
        <nav>
          <Link to="/">홈</Link>
          <Link to="/about">소개</Link>
          <Link to="/contact">연락처</Link>
        </nav>
      );
}

export default NavBar;
